import React from 'react';
import ReactDOM from 'react-dom/client';
import './css/normalize.css';
import './css/style.css';
import jfast from './images/icons/jfastSFX.svg';
import App from './main';

const root = ReactDOM.createRoot(document.querySelector('.body'));
root.render(
  <React.StrictMode>
    <section className='about'>
     <p>Todos los derechos reservados para "Ionic" y el uso de sus iconos "Ion-icons" &#169; <b className="year">2022</b></p>
		  <a href="https://github.com/Josafast" target="_BLANK"><img src={jfast} /></a>
		  <a href="https://github.com/Josafast/Calculator"><img src={'./images/icons/logo-github.svg'} /></a>
    </section>
    <App />
  </React.StrictMode>
);
